Первое спряжение глаголов применяется для глаголов в настоящем времени.<br>
Окончание изменяется в зависимости от окончания в третьем лице.<br>

Пример:<br>
dirb<b>ti</b> - работать<br>
dirb<b>a</b> - (он/она) работает<br>
dirb<b>u</b> - (я) работаю<br>
окончание <b>-a</b> заменяется на <b>-u</b><br>
<br>
