В литовском языке существительные делятся на мужской и женский род.<br>
Слова с окончаниями <b>-as</b>, <b>-us</b>, <b>-ys</b>, <b>-is</b> обычно мужского рода.<br>
Слова с окончаниями <b>-a</b>, <b>-ė</b> обычно женского рода.<br>
<br>
Примеры:<br>
мужской род: universitet<b>as</b> - университет, student<b>as</b> - студент<br>
женский род: klinik<b>a</b> - клиника, , student<b>ė</b> - студентка<br>
<br>
Но есть исключения. Например слово moter<b>is</b>(женщина) женского рода.<br>}', false);
